import { FC } from "react";

type LoginProps = {};

const Login: FC<LoginProps> = () => {
  return (
    <div className="border border-red-600 flex justify-center mt-20">
      <form className="">
        <p className="text-center text-xl mb-10">Model Fashion</p>
        <div>
          <input
            className="border border-slate-800 rounded-md px-4 py-2 mb-4"
            type="text"
            placeholder="Email"
          />
        </div>
        <div>
          <input
            className="border border-slate-800 rounded-md px-4 py-2 mb-4"
            type="text"
            placeholder="Password"
          />
        </div>
        <button className="bg-sky-500 text-white rounded-md drop-shadow-md w-full">Sign in</button>
      </form>
    </div>
  );
};

export default Login;
